// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract TheDAO {
    address public owner;

    // 1) Declare the event
    event Transfer(address indexed _from, address indexed _to, uint256 _amount);

    // 2) Owner-only modifier
    modifier onlyOwner() {
        require(msg.sender == owner, "Not the owner");
        _;
    }

    // 3) Set the deployer as owner
    constructor() {
        owner = msg.sender;
    }

    // 4) Example function that emits the Transfer event
    function doTransfer(address _to, uint256 _amount) external onlyOwner {
        // In a real contract, you'd check balances, etc.
        // Here we simply emit the event
        emit Transfer(msg.sender, _to, _amount);
    }
}

